<!DOCTYPE html>
<html>
<head>
<title>jQuery lightbox clone - prettyPhoto - by Stephane Caron</title>

<script src="https://ajax.googleapis.com/ajax/libs/jquery/1.9.0/jquery.min.js" type="text/javascript"></script>
<!--script src="http://www.topmodels-airstudio.com/wixvideo/js/jquery.lint.js" type="text/javascript" charset="utf-8"></script-->
<link rel="stylesheet" href="http://alpbak.github.io/airstudio/prettyPhoto.css" type="text/css" media="screen" title="prettyPhoto main stylesheet" charset="utf-8" />
<script src="http://alpbak.github.io/airstudio/jquery.prettyPhoto.js" type="text/javascript" charset="utf-8"></script>

<script>
$(function() {
    $("iframe").contents().find("a[rel^='prettyPhoto']").click(function() { $(this).prettyPhoto(); return false; } );
});
</script>


</head>

</body>
</html>
